import React from 'react';
import '../App.css';
import { Col, Container, Row, Image } from 'react-bootstrap';
import SaltForkMap from '../Componets/rivers/salt-fork.jpg'
import Calendar from '../Componets/calendar/index';



export default function BookingPage({ routeSelected, value, setValue, back, booked, kayaksInStock , form}){





  //whats rendered to the DOM
  return (
      <div >
        <h1>{ routeSelected}</h1>
        booking page
        <Calendar value={value} setValue={setValue} back={back} booked={booked} kayaksInStock={kayaksInStock} form={form} />
      </div>
  )
}
